import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'app';
  bodyText = 'This text can be updated in modal 1';

  constructor(protected modalService: ModalService) { }
}
